import React from "react";
import ResidentInfo from "./ResidentInfo"

const ResidentsList = ({ type }) => {
    return (
        <div className="residentsList container">
        {type.residents?.map((residents) => (
            <ResidentInfo url={residents.data.url} key={residents.data.url} />
        ))}
        </div>
    );
};

export default ResidentsList;
